import axios from "axios";
import { useEffect, useState } from "react"; //to use function to get information  and useState to store data
import {Ta } from "react-bootstrap";

function DoctAss() {

    useEffect(() => {
        axios.get("http://localhost:4000/doctorAss", { withCredentials: true })
            .then(res => {
                console.log(res.data.drassigmnent.dr[0]);
            }).catch(err => console.log(err));
    }, [])
    return (
        <Table striped bordered hover>
            <thead>
                <tr>
                    <th>#</th>
                    <th>First Name</th>
                    <th>Last Name</th>
                    <th>Username</th>
                </tr>
            </thead>
            <tbody>
                <tr>
                    <td>1</td>
                    <td>Mark</td>
                    <td>Otto</td>
                    <td>@mdo</td>
                </tr>
                <tr>
                    <td>2</td>
                    <td>Jacob</td>
                    <td>Thornton</td>
                    <td>@fat</td>
                </tr>
                <tr>
                    <td>3</td>
                    <td colSpan="2">Larry the Bird</td>
                    <td>@twitter</td>
                </tr>
            </tbody>
        </Table>
    )
}

export default DoctAss;
